"""##**Text Preprocessing**


1.   Lowercase
2.   Remove punctuations
3.   Tokenize
4.   Stopword Removal
5.   Lemmatize

lowercase

** Lowercase:¶**
Converting text to lowercase is a common preprocessing step in NLP, and it is often done in conjunction with expanding contractions. There are several reasons why this is done:

Normalization: Converting all text to lowercase helps to normalize the text, which means that different variations of the same word will be treated as the same token. For example, if "dog" and "Dog" were not normalized to the same case, they would be treated as different tokens even though they have the same meaning.

Vocabulary Reduction: When we convert text to lowercase, we reduce the size of our vocabulary by collapsing all variants of a word into a single token. This is particularly important for applications with limited resources, such as mobile devices or embedded systems.

Case Sensitivity: Many NLP tasks are case sensitive, meaning that "dog" and "Dog" would be treated as different words. However, in many cases, we do not want the model to be sensitive to case because it can introduce unnecessary noise in the data. For example, if we are trying to classify documents by topic, we likely do not care if "Dog" is capitalized or not.

Consistency: Converting all text to lowercase helps to ensure consistency in the data, which can improve the accuracy and reliability of NLP models. For example, if some text is in uppercase and some is in lowercase, it could be more difficult for the model to identify patterns and make accurate predictions.

##Lowercase
"""

data.loc[:,'Review'] = data.loc[:,'Review'].apply(lambda x: " ".join(x.lower() for x in x.split()))

data.head()

"""**Removing Punctuation**

**Remove punctuations:¶**
Removing punctuations is a common preprocessing step that is often done after expanding contractions and converting text to lowercase. There are several reasons why this is done:

Noise Reduction: Punctuations such as periods, commas, and semicolons add noise to the data, making it more difficult for NLP models to identify patterns and extract meaningful information. By removing punctuations, we can reduce the amount of noise in the data and improve the accuracy of NLP models.

Tokenization: Punctuation marks are often used to separate words and phrases, which means that if we keep them in the text, they will be treated as separate tokens. By removing punctuations, we can improve the accuracy of tokenization and ensure that words are correctly identified as separate tokens.

Normalization: Punctuations are not typically informative and can create unnecessary variability in the data. Removing punctuations can help to normalize the text and reduce the amount of variability in the data.

Consistency: Similar to converting text to lowercase, removing punctuations can help to ensure consistency in the data. By removing punctuations, we can reduce the number of variations of the same word or phrase and improve the accuracy and reliability of NLP models.

However, it's worth noting that in some NLP applications, such as sentiment analysis or emotion detection, punctuations can be informative and may carry important signals about the sentiment or emotion in the text. In such cases, removing punctuations may not be desirable. Therefore, the decision to remove or keep punctuations depends on the specific application and the goals of the analysis.
"""

import re
data['Review'] = data['Review'].apply(lambda x: re.sub('[%s]' % re.escape(string.punctuation), '' , x))
data.head()

"""**Removing stopwords:¶**
Stopwords are words that are considered to be common or uninformative and are typically removed from the text before analysis. Examples of stopwords include "the", "and", "a", "an", "in", "of", and "to". There are several reasons why we remove stopwords for text processing in NLP:

Noise Reduction: Stopwords add noise to the data and can make it more difficult for NLP models to identify meaningful patterns and extract useful information. By removing stopwords, we can reduce the amount of noise in the data and improve the accuracy of NLP models.

Vocabulary Reduction: Stopwords are typically very common, which means that they appear frequently in the text. Removing stopwords can help to reduce the size of the vocabulary and make it easier for NLP models to process the text.

Normalization: Stopwords do not typically carry much meaning and can create unnecessary variability in the data. Removing stopwords can help to normalize the text and reduce the amount of variability in the data.

Consistency: Similar to converting text to lowercase and removing punctuations, removing stopwords can help to ensure consistency in the data. By removing stopwords, we can reduce the number of variations of the same word or phrase and improve the accuracy and reliability of NLP models.
"""

from nltk.corpus import stopwords
sw=stopwords.words("english")
data["Review"]=data["Review"].apply(lambda x: " ".join(x for x in x.split() if x not in sw))
data.head()

"""**Lemmatization:¶**
Lemmatization is the process of reducing words to their base or root form, known as a lemma. The goal of lemmatization is to transform words into their canonical or dictionary form, which helps to reduce the dimensionality of the data and improve the accuracy of NLP models.

For example, the lemma of the word "running" is "run", and the lemma of the word "mice" is "mouse". By reducing all variations of a word to its base form, we can treat different forms of the same word as a single term, which can improve the accuracy of NLP models.

Lemmatization is different from stemming, another technique for reducing words to their root form. While stemming involves simply removing the suffixes from words to reduce them to a common root form, lemmatization involves using a dictionary or morphological analysis to identify the base form of each word.

In NLP, lemmatization is often used as a preprocessing step before other analyses, such as text classification or sentiment analysis. It helps to reduce the noise in the data by standardizing words to their base forms, which in turn helps to improve the accuracy of NLP models. Additionally, lemmatization can help to address the problem of sparsity, which can occur when different forms of the same word are treated as separate terms, leading to overfitting and reduced accuracy. Overall, lemmatization is a useful technique for reducing the dimensionality of the data and improving the accuracy and efficiency of NLP models.
"""

lemmat = WordNetLemmatizer()
data.loc[:,'Review'] = data.loc[:,'Review'].apply(lambda word: " ".join(lemmat.lemmatize(word) for word in word.split()))
data.head(10)

