def all_models(X_train,X_test, y_train,y_test):
    # Tum Base Modeller (Classification)
    from sklearn.linear_model import LogisticRegression
    from sklearn.svm import SVC
    from sklearn.neighbors import KNeighborsClassifier
    from sklearn.neural_network import MLPClassifier
    from sklearn.tree import DecisionTreeClassifier
    from sklearn.ensemble import RandomForestClassifier
    from xgboost import XGBClassifier
    from lightgbm import LGBMClassifier
    from sklearn.ensemble import GradientBoostingClassifier



    models = [('LR', LogisticRegression()),
                  ('KNN', KNeighborsClassifier()),
                  ('DT', DecisionTreeClassifier()),
                  ('RF', RandomForestClassifier()),
                  ('SVM', SVC(gamma='auto')),
                  ('XGB', XGBClassifier())]

    for name, model in models:
      model.fit(X_train, y_train)
      y_pred = model.predict(X_test)
      cf_matrix=confusion_matrix(y_test,y_pred)
      sns.heatmap(cf_matrix,annot=True,cbar=False,fmt="g")
      model_score=accuracy_score(y_test, y_pred)
      plt.xlabel("y_pred")
      plt.ylabel("y_test")
      plt.title(str(name)+" "+"Model Accuracy:"+str(model_score))
      plt.show()
      print(str(name)+"   classification_Report")
      print(classification_report(y_test, y_pred))

"""**Count Vectorization-ML Algorithms**"""

all_models(X_train_count,X_test_count,y_train,y_test)

all_models(X_train_tfidf,X_test_tfidf,y_train,y_test)